import { useEffect, useState } from "react";
import { useSelector } from "react-redux";
import "./grades.css";

function Grades() {
  const [grades, setGrades] = useState([]);
  const utis = useSelector((state) => state.class.UTIS);

  useEffect(() => {
    const storedGrades = localStorage.getItem("grades");
    if (storedGrades) {
      setGrades(JSON.parse(storedGrades));
    }

    const fetchGrades = async () => {
      try {
        const response = await fetch("http://localhost:8000/gradesof/" + utis);
        if (response.ok) {
          const data = await response.json();
          setGrades(data);
          localStorage.setItem("grades", JSON.stringify(data));
        } else {
          console.error("Error fetching grades");
        }
      } catch (error) {
        console.error(error);
      }
    };
    
    fetchGrades();
  }, []);

  return (
    <div className="grades-container">
      {grades.map((grade, index) => (
        <div key={index} className="grade-card">
          <h3 className="test-name">Test Name: {grade.testName}</h3>
          <p className="result">Result: {grade.result}</p>
        </div>
      ))}
    </div>
  );
}

export default Grades;
